public static synchronized void dynamicallyInstrument(
			String[] includes, String[] excludes)
		throws UnmodifiableClassException {

		if ((_instrumentation == null) || _dynamicallyInstrumented) {
			return;
		}

		if (includes == null) {
			includes = _includes;
		}

		if (excludes == null) {
			excludes = _excludes;
		}

		String agentLine = System.getProperty("whip.agent");

		int index = agentLine.indexOf('=');

		if (index != -1) {
			StringBuilder sb = new StringBuilder();

			sb.append(agentLine, 0, index + 1);

			for (String include : includes) {
				sb.append(include);
				sb.append(',');
			}

			if (includes.length > 0) {
				sb.setLength(sb.length() - 1);
			}

			sb.append(';');

			for (String exclude : excludes) {
				sb.append(exclude);
				sb.append(',');
			}

			if (excludes.length > 0) {
				sb.setLength(sb.length() - 1);
			}

			System.setProperty("whip.agent", sb.toString());
		}

		if (_whipClassFileTransformer == null) {
			_whipClassFileTransformer = new WhipClassFileTransformer(
				includes, excludes);
		}

		_instrumentation.addTransformer(_whipClassFileTransformer, true);

		Class<?>[] allLoadedClasses =_instrumentation.getAllLoadedClasses();

		List<Class<?>> modifiableClasses = new ArrayList<>();

		for (Class<?> loadedClass : allLoadedClasses) {
			if (_instrumentation.isModifiableClass(loadedClass)) {
				String className = loadedClass.getName();

				className = className.replace('.', '/');

				if (_whipClassFileTransformer.matches(className)) {
					modifiableClasses.add(loadedClass);
				}
			}
		}

		_instrumentation.retransformClasses(
			modifiableClasses.toArray(new Class<?>[modifiableClasses.size()]));

		_dynamicallyInstrumented = true;
		_originalClassDefinitions = null;
	}

protected boolean handleAssociationAttribute(AssociationAttributeDefinition attributeDefinition) {

		final FetchStrategy fetchStrategy = determineFetchStrategy( attributeDefinition );
		if ( fetchStrategy.getTiming() != FetchTiming.IMMEDIATE ) {
			return false;
		}

		final ExpandingFetchSource currentSource = currentSource();
		currentSource.validateFetchPlan( fetchStrategy, attributeDefinition );

		final AssociationAttributeDefinition.AssociationNature nature = attributeDefinition.getAssociationNature();
		if ( nature == AssociationAttributeDefinition.AssociationNature.ANY ) {



			currentSource.buildAnyAttributeFetch(
					attributeDefinition,
					fetchStrategy
			);
			return false;
		}
		else if ( nature == AssociationAttributeDefinition.AssociationNature.ENTITY ) {
			EntityFetch fetch = currentSource.buildEntityAttributeFetch(
					attributeDefinition,
					fetchStrategy
			);
			if ( fetchStrategy.getStyle() == FetchStyle.JOIN ) {
				pushToStack( (ExpandingFetchSource) fetch );
				return true;
			}
			else {
				return false;
			}
		}
		else {

			CollectionAttributeFetch fetch = currentSource.buildCollectionAttributeFetch( attributeDefinition, fetchStrategy );
			if ( fetchStrategy.getStyle() == FetchStyle.JOIN ) {
				pushToCollectionStack( fetch );
				return true;
			}
			else {
				return false;
			}
		}
	}

